import React from "react";

export default function LogoMedium({ className }) {
  return (
    <h2>
      <img
        className={className}
        alt="logo"
        src="https://res.cloudinary.com/dhd9jgrw3/image/upload/v1586884639/drivers/logo/logo_hrzntl_nympql.png"
      />
    </h2>
  );
}
